    function getDaysInMonth(monthName, year) {
    const months = {
        "01": 31,
        "02": 28, // Assuming non-leap year by default
        "03": 31,
        "04": 30,
        "05": 31,
        "06": 30,
        "07": 31,
        "08": 31,
        "09": 30,
        "10": 31,
        "11": 30,
        "12": 31,
        "98": 98
    };

    // Convert monthName to uppercase for case-insensitive matching
    const uppercaseMonth = monthName.toUpperCase();

    // Check if the uppercase month name exists in the months object
    if (uppercaseMonth in months) {
        // Check if it's a leap year and update February's days accordingly
        if (uppercaseMonth === "02" && year % 4 === 0 && (year % 100 !== 0 || year % 400 === 0)) {
            return 29;
        } else {
            return months[uppercaseMonth];
        }
    } else {
        // Month name not recognized
        return -1;
    }
}

